<!DOCTYPE html>
<html lang="en">

<head>
	<meta charset="UTF-8">
	<meta http-equiv="X-UA-Compatible" content="IE=edge">
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<title>Jolly World - Modder</title>
	<script src="https://cdnjs.cloudflare.com/ajax/libs/jszip/3.6.0/jszip.min.js"></script>
	<script src="https://cdn.jsdelivr.net/npm/idb-keyval@5/dist/iife/index-min.js"></script>
	<style>
		html,
		body {
			width: 100%;
			height: 100%;
			margin: 0;
			padding: 0;
			background: #e7b98a;
			overflow: hidden;
		}

		#logo{
			display: block;
			margin: 20px auto;
		}

		#dropzone {
			background: rgb(211 161 109);
			border: 7px dotted #e7b98a;
			position: relative;
			width: 400px;
			height: 200px;
			display: flex;
			justify-content: center;
			align-items: center;
			margin: auto;
			cursor: pointer;
		}
		#dropzone input{
			cursor: pointer;
		}

		#label {
			color: #9CF6FF;
			font-family: "Lily Script One", cursive;
			text-shadow: 2.2px 2px #000;
			text-align: center;
			line-height: 38px;
			font-size: 24px;
			text-rendering: geometricPrecision;
		}

		#files {
			opacity: 0;
			width: 100%;
			height: 100%;
			position: absolute;
		}

		h1,
		h2 {
			color: #fff;
			font-family: "Lily Script One", cursive;
			text-shadow: 2.2px 2px #000;
			text-align: center;
			text-rendering: geometricPrecision;
		}

		h1 {
			font-size: 56px;
		}

		h2 {
			font-size: 24px;
		}
		.button{
			cursor:pointer;
			background-color: red;
			width: 200px;
			height: 38px;
			border-radius: 8px;
			border: 2px solid black;
			box-shadow: inset 0px 2px 1px rgb(255 255 255 / 60%), 0px 0px 0px 1px white, 2px 2px 2px black;
			color: white;
			font-family: "Lily Script One", cursive;
			text-shadow: 1.2px 2px black;
			text-align: center;
			line-height: 38px;
			font-size: 23px;
			text-rendering: geometricPrecision;
			cursor: pointer;
			white-space: nowrap;
			margin: 20px auto;
		}
		.button:hover{
			filter: brightness(1.2);
		}
		#more, #back{
			display:block;
			text-decoration: none;
			background-color: #FF6600;
		}
		#back{
			background-color: #7B7B7B;
		}

		#how{
			color: black;
			font-family: sans-serif;
			margin: 80px auto;
			width: fit-content;
			text-align: center;
		}

		#list{
			width: fit-content;
    		text-align: left;
			text-decoration: none;
			line-height: 24px;
		}
		#list a{
			color: #9CF6FF;
			font-weight: bold;
			text-shadow: 2px 2px black;
			text-decoration: none;
		}
		.scroll{
			width: 100%;
			height: 100%;
			overflow-y: scroll;
		}

		@import url('https://fonts.googleapis.com/css2?family=Lily+Script+One&display=swap');
	</style>
</head>

<body>
	<div class="scroll">
		<img src="terms/JollyModder.png" id="logo"></img>
		<div id="dropzone">
			<input type="file" id="files" name="drop" />
			<h2 id="label">Drop mod .zip here to install</h2>
		</div>
		<h2 id="installed">
			Installed Mod:
			<span>none</span>
		</h2>
		<div id="remove" class="button">
			Remove Mod
		</div>
		<a id="more" class="button" href="https://discord.gg/ZbtZMupFzG" target="_blank" rel="noopener noreferrer">
			More Mods
		</a>
		<div id="back" class="button">
			Back to Game
		</div>

		<div id="how">
			Steps to modify the game textures:
			<ol id="list">
				<li>Download the game textures <a id="link" href="../jollymod.zip" target="_blank" rel="noopener noreferrer">HERE</a></li>
				<li>Read the instructions inside <i>_README.txt</i></li>
				<li>Upload your modified zip</li>
			</ol>
		</div>
	</div>
	<script>
		const backButton = document.querySelector('#back');
		backButton.onclick = function(){
			if (document.referrer == "") {
				window.open("https://jollyworld.app");
			} else {
				window.history.back();
			}
		}
	</script>
